INSERT INTO `faqdescs` VALUES (18,3,'Will my coins get deducted if I stop doing my acts?','Rest assured, your hard-earned coins will not be deducted. We recognize and appreciate your consistent efforts, and those rewards are yours to keep.','2024-05-03 07:45:20','2024-05-03 07:45:20'),(19,3,'How can I ensure my updates remain private?','To maintain privacy for your updates, simply navigate to ‚ÄòMy Profile‚Äô, then select ‚ÄòKeep My Program Updates Private‚Äô, and toggle the switch to off.','2024-05-03 07:45:20','2024-05-03 07:45:20'),(20,3,'How can I give myself a shoutout?','You can proudly showcase your progress by visiting the \'Leaderboard\' and choosing \'Share My Progress\' to create a card that can be shared across your social world.','2024-05-03 07:45:20','2024-05-03 07:45:20'),(21,3,'How many acts should I aim to complete each day?','Each program asks for one act daily. Depending on how many programs you\'re enrolled in, you\'ll complete the same number of acts. For example, if you\'re in three programs, you‚Äôll have to perform three acts every day.','2024-05-03 07:45:20','2024-05-03 07:45:20'),(22,2,'How can I request a new program?','To request a new program, navigate to the \'Programs\' section, then click on \'Explore\', followed by \'View All\'. From there, select \'Request Program\', fill out the requirements, and send us your request. We\'ll review it and curate a program tailored just for you.','2024-05-03 07:52:08','2024-05-03 07:52:08'),(23,2,'How long does it take to complete a program?','Bursting the myths of habit formation, each user\'s journey is unique. Therefore, we\'ve set only a minimal number of days to complete all habits in a program. However, after every 18 repetitions of a habit, you have the option to proceed to the next habit in the same program or continue with the same habit if you feel it hasn\'t become a part of your routine. This feature sets our app apart, ensuring that every journey is meaningful and personalized.','2024-05-03 07:52:08','2024-05-03 07:52:08'),(24,2,'Where can I use my stars and coins?','Stars can be used for in-app purchases like unlocking personal programs, while coins, which are equivalent to rupees, can be redeemed for products or experiences based on your preferences.','2024-05-03 07:52:08','2024-05-03 07:52:08'),(25,2,'How often can I enroll in programs?','At Aspire, we encourage you to grow at your own pace. Once you\'ve established a routine of completing tasks and feel confident, you can sign up for new programs once you\'ve accumulated enough coins to unlock them.','2024-05-03 07:52:08','2024-05-03 07:52:08'),(26,1,'About Aspire','Aspire enables employees to lead a better life, stay longer & grow in your organization by creating workplace habits.','2024-05-03 07:57:01','2024-05-03 07:57:01'),(27,1,'Why does the app emphasize 5 minutes or less?','We intend to make it easy for you. One of the habit formation laws states that if the habit is 5 minutes or less, it is easy for you to pick it up and make it a part of your system.','2024-05-03 07:57:01','2024-05-03 07:57:01'),(28,1,'Are the acts pre-set?','Yes, our team of subject matter and behavioral science experts curates the program with pre-set acts. They follow a standardized framework to create the best possible set of actions, ensuring that they align with the program\'s objectives and are stacked sequentially to make a difference.','2024-05-03 07:57:01','2024-05-03 07:57:01'),(29,1,'Where can I find support?','You can find the support icon by navigating to ‚ÄòPrograms‚Äô -> ‚ÄòExplore‚Äô -> ‚ÄòHelp‚Äô. You can also reach out to us directly at staylivegrow@aspirenow.in','2024-05-03 07:57:01','2024-05-03 07:57:01'),(30,1,'What should I do if I\'m stuck?','If you find yourself stuck, feel free to email us at \"staylivegrow@aspirenow.in\", and one of our coaches will reach out to you for a one-on-one call. They\'ll help you stay consistent and address any queries related to your habits.','2024-05-03 07:57:01','2024-05-03 07:57:01');
