CREATE TABLE `feeds` (
  `id` int NOT NULL AUTO_INCREMENT,
  `fileUrl` varchar(255) DEFAULT NULL,
  `programCoins` int DEFAULT NULL,
  `programPoints` varchar(255) DEFAULT NULL,
  `postType` varchar(255) DEFAULT NULL,
  `programType` varchar(255) DEFAULT NULL,
  `text` varchar(255) DEFAULT NULL,
  `programTowerHeight` int DEFAULT NULL,
  `audioUrl` varchar(2555) DEFAULT NULL,
  `programName` varchar(255) DEFAULT NULL,
  `backgroundImageUrl` varchar(255) DEFAULT NULL,
  `programImage` varchar(255) DEFAULT NULL,
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL,
  `userId` int DEFAULT NULL,
  `taskId` int DEFAULT NULL,
  `programId` int DEFAULT NULL,
  `customerId` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `userId` (`userId`),
  KEY `taskId` (`taskId`),
  KEY `programId` (`programId`),
  KEY `customerId` (`customerId`),
  CONSTRAINT `feeds_ibfk_1` FOREIGN KEY (`userId`) REFERENCES `users` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `feeds_ibfk_2` FOREIGN KEY (`taskId`) REFERENCES `tasks` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `feeds_ibfk_3` FOREIGN KEY (`programId`) REFERENCES `programs` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `feeds_ibfk_4` FOREIGN KEY (`customerId`) REFERENCES `customers` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
