INSERT INTO `onboardingQuestions` VALUES (124,'Do you think you take control of yourself when it comes to your own growth and development?','option','https://postactionsbucket.s3.ap-south-1.amazonaws.com/uploads/onboarding_images/1.png','2024-04-18 06:33:16','2024-04-18 06:33:16'),(125,'Have you consciously tried improve anything specific at work or your life outside of work?','option','https://postactionsbucket.s3.ap-south-1.amazonaws.com/uploads/onboarding_images/2.png','2024-04-18 06:33:16','2024-04-18 06:33:16'),(126,'Consistency is the key in improving anything. What are your frequent barriers to that?','option','https://postactionsbucket.s3.ap-south-1.amazonaws.com/uploads/onboarding_images/3.png','2024-04-18 06:33:16','2024-04-18 06:33:16'),(127,'Are there specific career-specific growth you\'d like to track or measure for improvement?','text','https://postactionsbucket.s3.ap-south-1.amazonaws.com/uploads/onboarding_images/4.png','2024-04-18 06:33:17','2024-04-18 06:33:16'),(128,'Are there any specific tools or techniques you\'ve tried in the past to become better at work?','combined','https://postactionsbucket.s3.ap-south-1.amazonaws.com/uploads/onboarding_images/5.png','2024-04-18 06:33:17','2024-04-18 06:33:16'),(129,'How do you think a team could help you with your personal growth?','option','https://postactionsbucket.s3.ap-south-1.amazonaws.com/uploads/onboarding_images/6.png','2024-04-18 06:33:17','2024-04-18 06:33:16'),(130,'How much do you rely on technology for working on yourself?','option','https://postactionsbucket.s3.ap-south-1.amazonaws.com/uploads/onboarding_images/7.png','2024-04-18 06:33:17','2024-04-18 06:33:16'),(131,'What motivates you the most?','option','https://postactionsbucket.s3.ap-south-1.amazonaws.com/uploads/onboarding_images/8.png','2024-04-18 06:33:17','2024-04-18 06:33:16'),(132,'What is the product/experience you want to gift yourself through Aspire?','multipletextwithoptions','https://postactionsbucket.s3.ap-south-1.amazonaws.com/uploads/onboarding_images/9.png','2024-04-18 06:33:17','2024-04-18 06:33:16'),(133,'When do you want to work on yourself?','time','https://postactionsbucket.s3.ap-south-1.amazonaws.com/uploads/onboarding_images/10.png','2024-04-18 06:33:17','2024-04-18 06:33:16');
