DROP TABLE IF EXISTS `userPrograms`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `userPrograms` (
  `id` int NOT NULL AUTO_INCREMENT,
  `isCompleted` tinyint(1) DEFAULT '0',
  `progressPercentage` int DEFAULT '0',
  `programEarnedPoints` int DEFAULT '0',
  `programEarnedCoins` int DEFAULT '0',
  `programLeaderboard` int DEFAULT '0',
  `userProgramPicture` varchar(255) DEFAULT NULL,
  `isJoined` tinyint(1) DEFAULT '0',
  `programTowerHeight` varchar(255) DEFAULT NULL,
  `isProgramQuestionAnswered` tinyint(1) DEFAULT '0',
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL,
  `userId` int DEFAULT NULL,
  `programId` int DEFAULT NULL,
  `customerId` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `userId` (`userId`),
  KEY `programId` (`programId`),
  KEY `customerId` (`customerId`),
  CONSTRAINT `userPrograms_ibfk_1` FOREIGN KEY (`userId`) REFERENCES `users` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `userPrograms_ibfk_2` FOREIGN KEY (`programId`) REFERENCES `programs` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `userPrograms_ibfk_3` FOREIGN KEY (`customerId`) REFERENCES `customers` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=323 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

